import{_ as e,o as t,c as o,k as _,a}from"./chunks/framework.cc795e4d.js";const R=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"docs/治疗进展/胰岛素专题/在主要为中国2型糖尿病-T2D-成人患者中-超快速赖脯胰岛素-URLi-相较于优泌乐-HL-改善餐后血糖-PPG-波动.md","filePath":"docs/治疗进展/胰岛素专题/在主要为中国2型糖尿病-T2D-成人患者中-超快速赖脯胰岛素-URLi-相较于优泌乐-HL-改善餐后血糖-PPG-波动.md"}'),s={name:"docs/治疗进展/胰岛素专题/在主要为中国2型糖尿病-T2D-成人患者中-超快速赖脯胰岛素-URLi-相较于优泌乐-HL-改善餐后血糖-PPG-波动.md"},i=_("h3",{id:"在主要为中国2型糖尿病-t2d-成人患者中-超快速赖脯胰岛素-urli-相较于优泌乐-hl-改善餐后血糖-ppg-波动",tabindex:"-1"},[a("在主要为中国2型糖尿病(T2D)成人患者中，超快速赖脯胰岛素(URLi)相较于优泌乐(HL)改善餐后血糖(PPG)波动 "),_("a",{class:"header-anchor",href:"#在主要为中国2型糖尿病-t2d-成人患者中-超快速赖脯胰岛素-urli-相较于优泌乐-hl-改善餐后血糖-ppg-波动","aria-label":'Permalink to "在主要为中国2型糖尿病(T2D)成人患者中，超快速赖脯胰岛素(URLi)相较于优泌乐(HL)改善餐后血糖(PPG)波动"'},"​")],-1),c=_("p",null,"上海交通大学附属第六人民医院Si Chen博士",-1),r=_("p",null,"URLi是赖脯胰岛素的一种新型制剂，开发目的是更好地匹配膳食的生理性胰岛素反应，吸收和起效比HL更快。本研究旨在评价URLi与HL在以中国成人T2D患者为主的人群中的疗效和安全性。此为3期、随机、双盲研究，主要终点是HbA1c从基线至第26周变化的治疗差异（非劣效性界值0.4%）。将第26周1和2小时PPG波动的治疗差异评估为多重性校正终点。URLi在 HbA1c变化方面达到了非劣效于HL。第26周时，URLi在控制1小时(4.8 mmol/Lvs. 5.6 mmol/L，P < 0.001)和2小时PPG波动(6.2 mmol/Lvs. 7.4 mmol/L，P < 0.001)方面优于HL。在26周治疗期间，两组的重度低血糖和记录的症状性低血糖的发生率相似且较低。两组之间严重不良事件和治疗后出现的不良事件的发生率相当。基础-餐时胰岛素方案中URLi与HL在主要为中国成人T2D患者中表现出非劣效的血糖控制（通过HbA1c评估）和优效的PPG波动控制，且安全性特征相似。",-1),n=[i,c,r];function L(l,d,P,m,p,h){return t(),o("div",null,n)}const U=e(s,[["render",L]]);export{R as __pageData,U as default};
